import React from 'react';
import {connect} from 'redux-bundler-react';
import classnames from 'classnames';

class HelpButton extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            expanded: true
        }
        this.toggleExpanded = this.toggleExpanded.bind(this);
    }
    toggleExpanded(){
        this.setState({
            expanded: !this.state.expanded
        })
        console.log("help was requested, please hold.")
    }
    render(){
        const {expanded} = this.state;
        const containerClass = classnames({
            "show" : expanded,
            "mr-2" : true
        })
        return (
                <button type="button" className="btn btn-outline-info mr-2" onClick={this.toggleExpanded}>
                    <i className="ms ms-help" title="Get Help."></i>
                </button>
        )
    }
}
export default connect(
    HelpButton
)
